import React, { Component } from 'react'

export class ProfilePage extends Component {

    render() {
        return(
            <div>
                <nav aria-label="breadcrumb">
                    <ol class="breadcrumb">
                    <li class="breadcrumb-item"><a href="/">Profile</a></li>
                    </ol>
                </nav>
            </div>
        );
    }
}

export default ProfilePage
